class Solution {
    func minimumOperations(_ num: String) -> Int {
        var ans = num.count // Worst case: remove all digits
        let nums = Array(num)
        let n = nums.count

        // Check for every pair if it can form a number divisible by 25
        for i in 0..<n {
            for j in i+1..<n {
                // Checking every combination of two digits in the number
                if ((nums[i] == "2" && nums[j] == "5") || 
                    (nums[i] == "7" && nums[j] == "5") || 
                    (nums[i] == "0" && nums[j] == "0") || 
                    (nums[i] == "5" && nums[j] == "0")) && j - i >= 1 {
                    // Calculate operations needed: (digits between i and j) + (digits after j) = j - i - 1 + n - j - 1
                    let ops = (j - i - 1) + (n - j - 1)
                    ans = min(ans, ops)
                }
            }
        }
        return ans
    }
}
